import React from 'react';
import './Button.css';
import SmallExplain from './SmallExplain'

class SmallButton extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            if (this.props.visible === false && this.props.buttonHide === false) {
            return (
                <div id="buttons">
                    <div id="circle">
                        <img className="smallButtonImage" src={require('./assets/crew-figure.png')}/><br />
                        <p id="smallButtonTag">Multi-User</p><br />
                    </div>
                    <SmallExplain visible={this.props.visible} buttonHide={this.props.buttonHide} />
                </div>
            )} else {
                return null
            }
        }
    }

export default SmallButton;
